using System;\nusing System.Collections.Generic;\nusing System.Diagnostics;\n\nclass Program\n{\n    static void Main()\n    {\n        // Define supported processes\n        HashSet<string> supportedProcesses = new HashSet<string>\n        {\n            "process1",\n            "process2",\n            "process3"\n        };\n\n        // Get the list of running processes\n        Process[] processList = Process.GetProcesses();\n        foreach (Process process in processList)\n        {\n            if (supportedProcesses.Contains(process.ProcessName))\n            {\n                Console.WriteLine($"Supported process running: {process.ProcessName}");\n            }\n        }\n    }\n}